define root view entity ZINF_DDL_I_007
  as select from zinf_t007 as t007
  left outer join DDCDS_CUSTOMER_DOMAIN_VALUE_T(p_domain_name: 'ZNF_D_ACC_TYPE') as domain on domain.language = $session.system_language
                                                                                          and domain.value_low = t007.acc_type
                                                                                        
{
  key t007.bukrs            as Bukrs,
  key t007.stock_hkont      as StockHkont,
  key t007.rldnr            as Rldnr,
      t007.acc_type         as AccType,
      domain.text           as AccTypeText,
      t007.blart            as Blart,
      t007.acc_principle    as AccPrinciple,
      t007.discount_hkont   as DiscountHkont,
      t007.discount_rate    as DiscountRate,
      t007.avr_index_rate   as AvrIndexRate,
      t007.correct_hkont_bs as CorrectHkontBs,
      t007.correct_hkont_pl as CorrectHkontPl
}
